人们追求财富，目的是为了让生活过得更好，可奇怪的是，人们一旦有了钱，反而更忙碌，更无法舒舒服服地过日子。

当生活不富裕的时候，很多人都想过“等我有了钱以后就可以怎么样怎么样”。在人们的想象中，“有钱”代表自由、独立、随心所欲--夏天可以到海边度假；冬天可以到山上去滑雪。

然而，当人们果真富有了，却发现自己根本无法去实现这些梦想--理由永远只有一个：“没时间！”不少高收入的人，几乎都是工作狂。

看来，“有钱”和“有闲”永远难以两全。难怪有人说：“当你年轻、没钱时，希望能用时间去换金钱；当你有钱后，却很难再用金钱买回时间。”     ћє@     ·@     ѕ@     ±@     ЪЇ@     ђЅ@     юј@     Є»@     r°@     „ј@     ъё@     т°@     Jё@     »@     Ё·@     Ёё@     [і@     "Ѕ@     ї@     шЅ@     ›І@     у»@     b±@     Z·@     *і@     њј@     ыё@     «µ@     с·@     еµ@     ]ё@     ъґ@     ЇІ@     У°@     zі@     J¶@     ё@     Ь±@     Iµ@     ¶@     Њј@     ї¶@     9±@     ?·@     в°@     ГІ@     і±@     |ё@     Е°@     °·@     ы°@     К№@     <ѕ@     Йё@     6ј@     ћ№@     @є@     oІ@     Gј@     1µ@     p±@     Л·@     –ё@     Јґ@     Э°@     щµ@     W±@     ћЇ@      ±@     №@     bј@     [¶@     >»@     Зј@     D·@     Љї@     ує@     аё@     ўє@     »@     њ»@     е¶@     єґ@     …ё@     ї@     ґє@     ¶@     Л°@     UЅ@     B№@     ё@     ґ@     qє@     ‚±@     w±@     Vё@     ±»@     6№@     ё@     Љ№@     эё@     №@     ¬ё@     ¬ѕ@     ,ѕ@     Cѕ@     7ё@     І@     lі@     ч№@     а±@     ґ@     Мє@     ‚Ї@     ‹ј@     »@     xЅ@     ?±@     dґ@     I»@     ¤і@     Yі@     Фµ@     Ѕ@     $є@     МЇ@     
