人们追求财富，目的是为了让生活过得更好，可奇怪的是，人们一旦有了钱，反而更忙碌，更无法舒舒服服地过日子。

当生活不富裕的时候，很多人都想过“等我有了钱以后就可以怎么样怎么样”。在人们的想象中，“有钱”代表自由、独立、随心所欲--夏天可以到海边度假；冬天可以到山上去滑雪。

然而，当人们果真富有了，却发现自己根本无法去实现这些梦想--理由永远只有一个：“没时间！”不少高收入的人，几乎都是工作狂。

